import { useNavigate } from 'react-router-dom'

const Navbar = () => {
    return (<nav className="nav">
        {/*<a href="/search">Hello friend!</a>*/}
        <button onClick={()=> navigate("/search")}>Hello friend!</button>
        <ul className="ul">
            <li>
                {/*<a className="b" href="/login">login</a>*/}
                <button onClick={()=> navigate("/login")}>login</button>
            </li>
            <li>
                {/*<a className="b" href="/regester">regester</a>*/}
                <button onClick={()=> navigate("/regester")}>regester</button>
            </li>
        </ul>
    </nav>);
};

export default Navbar
